import React, { useState } from 'react';
import { Button } from '@material-ui/core';

export default function File(){
const [count, setCount] = useState(0);

    return(
<div>
<h1>{count}</h1>
<Button color='primary' size='medium' variant='contained'>+</Button>
<Button color='secondary' size='medium' variant='contained'>-</Button>

</div>
    );
}
